import style from './Register.module.css';
import { http } from '../../hooks/http.hooks';

const RegisterContent = () => {

const sendRequest = async()=>{
    await request ('http://localhost:5000/register','POST',{})
}

}

const Register = () => {
    return (
        <div className={style['register-content']}>

            <div className={style['authorization']}>
                <p className={style['question-auth']}>Already have an account?</p>
                <p className={style['click-auth']}>Sign In</p>
            </div>

            <div className={style['footer']}>
                <p className={style['first-footer']}>Welcome to </p>
                <p className={style['second-footer']}>Hschool</p>
            </div>

            <p className={style['third-footer']}>Join and plan your week with Hschool</p>

            <ul className={style["list-input"]}>
                <li> <input className={style["name"]} placeholder="Full Name" /></li>
                <li> <input className={style["email"]} placeholder="Email" /></li>
                <li> <input type="password" className={style["password"]} placeholder="Password" /></li>
                <li> <input type="password" className={style["confirm-password"]} placeholder="Confirm Password" /></li>
            </ul>

            <div className={style["create-account"]}>
                <p className={style["text-create-account"]}>Create an account</p>
            </div>

            <div className={style['image']}></div>
        </div>
    );
}

export default Register;
